Telefon był zbyt gorący i wyłączył się, aby obniżyć temperaturę. Działa teraz normalnie.

Telefon może się przegrzać, gdy:
	• używasz aplikacji zużywających dużo zasobów (np. aplikacji do gier, nawigacji lub odtwarzania filmów);
	• pobierasz lub przesyłasz duże pliki;
	• używasz go w wysokiej temperaturze.
